INSERT INTO `module` VALUES ('basis','Basissysteem kan de drager identificeren en bevat uitbreidingspoorten voor alle combinaties van componenten',35495.00),('Cor','Houdt allerlei aspecten van het hart bij (hartslag / hartritme-wisselingen / fibrilaties). Deze informatie dient een breed spectrum aan medische doelen teneinde de vitaliteit van de drager te bewaken',23550.00),('Dermal','Houdt bij wanneer en hoe hard de drager aangeraakt wordt of zelf iets aanraakt. Hiermee kan bijgehouden worden hoeveel fysiek contact de drager heeft gedurende de dag of wellicht de nacht.',34690.00),('Memoria','Integreert met de prefrontale cortex van het brein van de drager zodat wanneer het breininformatie van het korte termijngeheugen verplaatst naar het lange termijngeheugen deze ook automatisch gekopieerd wordt in de memoria-module. De drager kan deze informatie altijd weer terughalen en afspelen.',139945.00),('Oculus','Integreert met het brein van de drager en kan opnamen maken van de dingen die de drager ziet. Zo kan een situatie later als videobestand gedownload en nog eens bekeken worden.',89945.00),('Oricula','Maakt geluidsopnamen van hetgeen de drager hoort en kan tevens aan de intonatie en manier van spreken op empatische wijze het gevoel van de spreker begrijpen - zoals ironie / sarcasme /melanchonie / enz.',65799.00),('Pes','Meet het aantal kilometers dat de drager op een dag aflegt. Aan de snelheid waarmee de drager zich verplaatst kan deze module ook begrijpen welk vervoersmiddel gebruikt wordt. Tevens wordt bijgehouden waar de drager zich bevond op een bepaald moment.',7800.00),('Sanguis','Meet de bloeddruk en bloedwaarden van de drager om mogelijk daarop een dieetadvies te geven. Als bepaalde bloedwaarden te laag of te hoog zijn dient te drager mogelijk iets te eten of drinken om deze weer te stabiliseren.',8990.00),('Somnus','Houdt bij wanneer de drager wakker is of slaapt. Kan tevens de kwaliteit van de slaap bepalen en verbetersuggesties geven',18380.00);
/*!40000 ALTER TABLE `module` ENABLE KEYS */;
UNLOCK TABLES;

